import "./HeaderNav.css";
import githubIcon from "../assets/github-icon.png";
import linkedinIcon from "../assets/linkedin-icon.png";
import resumeIcon from "../assets/resume-icon.png";

function HeaderNav(props) {
  return (
    <div className="navbar">
      <img src={props.logo} alt="" className="navLogo"></img>
      <icon src={props.icon} alt="" className="navIcon" id="github"></icon>
      <icon src={props.icon} alt="" className="navIcon" id="linkedin"></icon>
      <icon src={props.icon} alt="" className="navIcon" id="resume"></icon>
    </div>
  );
}

export default HeaderNav;
